import React from "react";
import { NavLink } from "react-router-dom";
import s from "./Dialogs.module.css";

const DialogItem = (props) => {
  return (
    <div className={s.dialog + " " + s.active}>
      <NavLink to={"/dialogs/" + props.id}>{props.username}</NavLink>
    </div>
  );
};

const Message = (props) => {
  return <div className={s.message}>{props.message}</div>;
};

let dialogItem = [
  ((id = "1"), (username = "Viktor")),
  ((id = "3"), (username = "Alex")),
  ((id = "2"), (username = "John")),
  ((id = "4"), (username = "Frank")),
  ((id = "5"), (username = "Maxim")),
];

let dialogMessages = [
  ((id = "1"), (message = "Hi")),
  ((id = "2"), (message = "How are you today")),
  ((id = "3"), (username = "John")),
  ((id = "4"), (username = "Frank")),
  ((id = "5"), (username = "Maxim")),
];

const Dialogs = (props) => {
  return (
    <div className={s.dialogs}>
      <div className={s.dialogItems}>
        <DialogItem id="1" username="Viktor" />
        <DialogItem id="3" username="Alex" />
        <DialogItem id="2" username="John" />
        <DialogItem id="4" username="Frank" />
        <DialogItem id="5" username="Maxim" />
      </div>
      <div className={s.messages}>
        <Message message="Hi" />
        <Message message="How are you doing today?" />
        <Message message="All good. How about you?" />
      </div>
    </div>
  );
};

export default Dialogs;
